ig\\".\\"ref_product\\" to \\"anon\\"","grant delete on table \\"config\\".\\"ref_product\\" to \\"authenticated\\"","grant insert on table \\"config\\".\\"ref_product\\" to \\"authenticated\\"","grant references on table \\"config\\".\\"ref_product\\" to \\"authenticated\\"","grant select on table \\"config\\".\\"ref_product\\" to \\"authenticated\\"","grant trigger on table \\"config\\".\\"ref_product\\" to \\"authenticated\\"","grant truncate on table \\"config\\".\\"ref_product\\" to \\"authenticated\\"","grant update on table \\"config\\".\\"ref_product\\" to \\"authenticated\\"","grant delete on table \\"config\\".\\"ref_product\\" to \\"prisma\\"","grant insert on table \\"config\\".\\"ref_product\\" to \\"prisma\\"","grant references on table \\"config\\".\\"ref_product\\" to \\"prisma\\"","grant select on table \\"config\\".\\"ref_product\\" to \\"prisma\\"","grant trigger on table \\"config\\".\\"ref_product\\" to \\"prisma\\"","grant truncate on table \\"config\\".\\"ref_product\\" to \\"prisma\\"","grant update on table \\"config\\".\\"ref_product\\" to \\"prisma\\"","grant delete on table \\"config\\".\\"ref_product\\" to \\"service_role\\"","grant insert on table \\"config\\".\\"ref_product\\" to \\"service_role\\"","grant references on table \\"config\\".\\"ref_product\\" to \\"service_role\\"","grant select on table \\"config\\".\\"ref_product\\" to \\"service_role\\"","grant trigger on table \\"config\\".\\"ref_product\\" to \\"service_role\\"","grant truncate on table \\"config\\".\\"ref_product\\" to \\"service_role\\"","grant update on table \\"config\\".\\"ref_product\\" to \\"service_role\\"","grant delete on table \\"config\\".\\"ref_stills\\" to \\"anon\\"","grant insert on table \\"config\\".\\"ref_stills\\" to \\"anon\\"","grant references on table \\"config\\".\\"ref_stills\\" to \\"anon\\"","grant select on table \\"config\\".\\"ref_stills\\" to \\"anon\\"","grant trigger on table \\"config\\".\\"ref_stills\\" to \\"anon\\"","grant truncate on table \\"config\\".\\"ref_stills\\" to \\"anon\\"","grant update on table \\"config\\".\\"ref_stills\\" to \\"anon\\"","grant delete on table \\"config\\".\\"ref_stills\\" to \\"authenticated\\"","grant insert on table \\"config\\".\\"ref_stills\\" to \\"authenticated\\"","grant references on table \\"config\\".\\"ref_stills\\" to \\"authenticated\\"","grant select on table \\"config\\".\\"ref_stills\\" to \\"authenticated\\"","grant trigger on table \\"config\\".\\"ref_stills\\" to \\"authenticated\\"","grant truncate on table \\"config\\".\\"ref_stills\\" to \\"authenticated\\"","grant update on table \\"config\\".\\"ref_stills\\" to \\"authenticated\\"","grant delete on table \\"config\\".\\"ref_stills\\" to \\"prisma\\"","grant insert on table \\"config\\".\\"ref_stills\\" to \\"prisma\\"","grant references on table \\"config\\".\\"ref_stills\\" to \\"prisma\\"","grant select on table \\"config\\".\\"ref_stills\\" to \\"prisma\\"","grant trigger on table \\"config\\".\\"ref_stills\\" to \\"prisma\\"","grant truncate on table \\"config\\".\\"ref_stills\\" to \\"prisma\\"","grant update on table \\"config\\".\\"ref_stills\\" to \\"prisma\\"","grant delete on table \\"config\\".\\"ref_stills\\" to \\"service_role\\"","grant insert on table \\"config\\".\\"ref_stills\\" to \\"service_role\\"","grant references on table \\"config\\".\\"ref_stills\\" to \\"service_role\\"","grant select on table \\"config\\".\\"ref_stills\\" to \\"service_role\\"","grant trigger on table \\"config\\".\\"ref_stills\\" to \\"service_role\\"","grant truncate on table \\"config\\".\\"ref_stills\\" to \\"service_role\\"","grant update on table \\"config\\".\\"ref_stills\\" to \\"service_role\\"","create extension if not exists \\"wrappers\\" with schema \\"extensions\\"","create schema if not exists \\"inventory\\"","create type \\"inventory\\".\\"drum_status\\" as enum ('en_route', 'in_stock', 'pending_allocation', 'allocated', 'rescheduled', 'decommissioned', 'empty', 'lost')","set check_function_bodies = off","CREATE OR REPLACE FUNCTION inventory.add_to_repro_drum(distillation_id integer, repro_material character varying, volume_to_add integer)\n RETURNS void\n LANGUAGE plpgsql\nAS $function$\nDECLARE\n    target_drum_id INTEGER;\n    remaining_capacity INTEGER;\nBEGIN\n    -- Find a suitable drum of the given material type with enough capacity\n    SELECT repro_drum_id, (capacity - current_volume) AS remaining_capacity\n    INTO target_drum_id, remaining_capacity\n    FROM repro_drums rd\n    WHERE rd.material_type = repro_material\n      AND rd.capacity - rd.current_volume >= volume_to_add\n      AND rd.volume_status = 'partial'  -- Ensure we only add to drums that are available for more material\n    ORDER BY rd.current_volume DESC  -- Prioritize the drum with the least amount of material\n    LIMIT 1;\n\n    -- If no suitable drum is found, create a new drum and get its ID\n    IF target_drum_id IS NULL THEN\n        INSERT INTO repro_drums (material_type, volume_status, current_volume) \n        VALUES (repro_material, 'partial', GREATEST(0, volume_to_add))\n        RETURNING repro_drum_id INTO target_drum_id;\n\n        -- Adjust the remaining volume to add after the new drum\n        volume_to_add = GREATEST(0, volume_to_add - 200);\n    END IF;\n\n    -- Check if the addition will breach capacity and handle overflow\n    IF current_volume + volume_to_add > capacity THEN\n        volume_to_add = capacity - current_volume; -- Adjust to fit into the current drum\n    END IF;\n\n    -- Update the selected drum's current volume\n    UPDATE repro_drums\n    SET current_volume = current_volume + volume_to_add,\n        updated_at = CURRENT_TIMESTAMP\n    WHERE repro_drum_id = target_drum_id;\n\n    -- Record this addition in the repro_additions table\n    INSERT INTO repro_additions (\n        repro_drum_id, \n        distillation_id, \n        date_added,\n        volume_added, \n        volume_in_drum\n    )\n    VALUES (\n        target_drum_id,\n        distillation_id,\n        CURRENT_DATE,\n        volume_to_add,\n        volume_to_add + remaining_capacity\n    );\n\n    -- Handle any overflow by recursively calling this function\n    IF volume_to_add > 0 THEN\n        PERFORM inventory.add_to_repro_drum(distillation_id, repro_material, volume_to_add);\n    END IF;\nEND;\n$function$","CREATE OR REPLACE FUNCTION inventory.create_new_drums()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n    -- Insert multiple new drum records using generate_series()\n    INSERT INTO inventory.new_drums (order_id, material, status, location)\n    SELECT\n        NEW.order_id,\n        NEW.material,\n        'en route', -- Default status\n        'new-site'   -- Default location\n    FROM\n        generate_series(1, NEW.quantity) AS drum_count; -- Creates rows based on quantity\n\n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION inventory.get_drum_inventory(material character varying)\n RETURNS TABLE(drum_id integer, import_id integer, material_type character varying, date_received date, supplier_name character varying, supplier_batch_code character varying, date_processed date)\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n    RETURN QUERY\n    SELECT \n        d.drum_id, \n        d.import_id, \n        d.material_type, \n        i.date_received, \n        i.supplier_name, \n        i.supplier_batch_code, \n        d.date_processed\n    FROM inventory.new_drums d\n    JOIN inventory.imports i ON d.import_id = i.import_id\n    WHERE d.material_type = material\n    ORDER BY i.date_received;\nEND;\n$function$","CREATE OR REPLACE FUNCTION inventory.handle_disposal_loss_transaction()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nDECLARE\n    drum_id INT;\nBEGIN\n    IF NEW.tx_type IN ('disposed', 'lost') THEN\n        drum_id := NEW.drum_id;\n        IF drum_id IS NOT NULL THEN\n            UPDATE inventory.new_drums\n            SET status = NEW.tx_type,\n                updated_at = CURRENT_TIMESTAMP\n            WHERE drum_id = drum_id;\n        END IF;\n    END IF;\n\n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION inventory.handle_intake_transaction()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nDECLARE\n    existing_delivery_id INT;\n    current_total_received INT;\n    order_qty INT;\nBEGIN\n    IF NEW.tx_type = 'intake' THEN\n\n        --------------------------------------------------------\n        -- 1) Find or Create Delivery row\n        --------------------------------------------------------\n        SELECT delivery_id\n        INTO existing_delivery_id\n        FROM inventory.deliveries\n        WHERE order_id = NEW.order_id\n          AND is_finalised = false\n        LIMIT 1;\n\n        IF existing_delivery_id IS NULL THEN\n            INSERT INTO inventory.deliveries (order_id, quantity_received, is_finalised, created_at)\n            VALUES (NEW.order_id, 1, false, CURRENT_TIMESTAMP)\n            RETURNING delivery_id INTO existing_delivery_id;\n        ELSE\n            UPDATE inventory.deliveries\n            SET quantity_received = quantity_received + 1,\n                updated_at = CURRENT_TIMESTAMP\n            WHERE delivery_id = existing_delivery_id;\n        END IF;\n\n        --------------------------------------------------------\n        -- 2) Update Orders (increment quantity_received)\n        --------------------------------------------------------\n        UPDATE inventory.orders\n        SET quantity_received = quantity_received + 1,\n            updated_at = CURRENT_TIMESTAMP\n        WHERE order_id = NEW.order_id\n        RETURNING quantity_received, quantity INTO current_total_received, order_qty;\n\n        --------------------------------------------------------\n        -- 3) If we have a known drum_id, set the drum to 'available'\n        --------------------------------------------------------\n        IF NEW.drum_id IS NOT NULL THEN\n            UPDATE inventory.new_drums\n            SET status = 'in stock',\n                updated_at = CURRENT_TIMESTAMP\n            WHERE drum_id = NEW.drum_id;\n        END IF;\n\n        --------------------------------------------------------\n        -- 4) If total_received == order_quantity => finalize\n        --------------------------------------------------------\n        IF current_total_received = order_qty THEN\n            UPDATE inventory.deliveries\n            SET is_finalised = true,\n                updated_at = CURRENT_TIMESTAMP\n            WHERE delivery_id = existing_delivery_id;\n\n            UPDATE inventory.orders\n            SET status = 'complete',\n                updated_at = CURRENT_TIMESTAMP\n            WHERE order_id = NEW.order_id;\n        END IF;\n\n        --------------------------------------------------------\n        -- 5) Link the transaction to the chosen delivery_id\n        --------------------------------------------------------\n        UPDATE inventory.transactions\n        SET delivery_id = existing_delivery_id\n        WHERE tx_id = NEW.tx_id;\n\n    END IF;\n\n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION inventory.handle_processed_transaction()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nDECLARE\n    drum_id INT;\nBEGIN\n    -- Check if the transaction type is 'processing'\n    IF NEW.tx_type = 'processed' THEN\n        -- Update the corresponding drum in the new_drums table\n        UPDATE inventory.new_drums\n        SET \n            status = CASE \n                        WHEN status <> 'en route' THEN 'processed'\n                        ELSE status\n                     END,\n            date_processed = CASE \n                                WHEN status <> 'en route' THEN NEW.tx_date\n                                ELSE NULL\n                             END,\n            updated_at = CASE \n                            WHEN status <> 'en route' THEN CURRENT_TIMESTAMP\n                            ELSE updated_at\n                         END\n        WHERE drum_id = NEW.drum_id;    -- Match the source drum\n    END IF;\n\n    -- Return the newly inserted row in the transactions table\n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION inventory.handle_processing_transaction()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$BEGIN\n    -- Check if the transaction type is 'processing'\n    IF NEW.tx_type = 'processed' THEN\n        -- Update the corresponding drum in the new_drums table\n        UPDATE inventory.new_drums\n        SET \n            status = CASE \n                        WHEN status <> 'en route' THEN 'processed'\n                        ELSE status\n                     END,\n            date_processed = CASE \n                                WHEN status <> 'en route' THEN NEW.tx_date\n                                ELSE NULL\n                             END,\n            updated_at = CASE \n                            WHEN status <> 'en route' THEN CURRENT_TIMESTAMP\n                            ELSE updated_at\n                         END\n        WHERE drum_id = NEW.drum_id;    -- Match the source drum\n    END IF;\n\n    -- Return the newly inserted row in the transactions table\n    RETURN NEW;\nEND;$function$","CREATE OR REPLACE FUNCTION inventory.mass_to_volume(_material_id integer, _weight numeric)\n RETURNS numeric\n LANGUAGE plpgsql\nAS $function$\nDECLARE\n    density NUMERIC;\nBEGIN\n    -- If weight is NULL, return default drum volume\n    IF _weight IS NULL THEN\n        RETURN 200;\n    END IF;\n    \n    -- Try to get density from raw_materials\n    SELECT density INTO density \n    FROM public.raw_materials rm \n    WHERE rm.material_id = _material_id;\n    \n    -- Calculate volume if density found\n    IF FOUND THEN\n        RETURN _weight / density;\n    ELSE\n        -- Default if material not found\n        RETURN 200;\n    END IF;\nEND;\n$function$","CREATE OR REPLACE FUNCTION inventory.prevent_excess_deliveries()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nDECLARE\n    total_received       INT;\n    order_quantity       INT;\n    delivery_status      TEXT;\n    quantity_remaining   INT;\n    existing_import_tx   INT;\nBEGIN\n    -- Only run if this is an import transaction\n    IF NEW.tx_type = 'intake' THEN\n\n        /*\n         1) Check if this drum has already been imported.\n            We look for any transaction with the same drum_id and tx_type = 'import'.\n            If found, raise an error to prevent duplicates.\n        */\n        SELECT tx_id\n        INTO existing_import_tx\n        FROM inventory.transactions\n        WHERE drum_id = NEW.drum_id\n          AND tx_type = 'intake'\n        LIMIT 1;\n\n        IF existing_import_tx IS NOT NULL THEN\n            RAISE EXCEPTION 'Drum with ID % has already been received.', NEW.drum_id;\n        END IF;\n\n        /*\n         2) Gather order info: total_received, order_quantity, and status\n         */\n        SELECT COALESCE(SUM(d.quantity_received), 0) AS total_received,\n               o.quantity AS order_quantity,\n               o.status AS delivery_status\n        INTO total_received, order_quantity, delivery_status\n        FROM inventory.orders o\n        LEFT JOIN inventory.deliveries d ON o.order_id = d.order_id\n        WHERE o.order_id = NEW.order_id\n        GROUP BY o.quantity, o.status;\n\n        IF delivery_status = 'complete' THEN\n            RAISE EXCEPTION 'Cannot add new deliveries. The order is already complete.';\n        END IF;\n\n        IF order_quantity IS NULL OR order_quantity = 0 THEN\n            RAISE EXCEPTION 'Invalid order quantity or order not found for order_id = %', NEW.order_id;\n        END IF;\n\n        -- quantity_remaining = how many more we can receive before hitting the order limit\n        quantity_remaining := order_quantity - total_received;\n\n        /*\n         3) We might not have a \\"quantity_received\\" column directly in NEW, because it's an import transaction row,\n            not a deliveries row. We typically add +1 for each import transaction. So let's define that logic:\n        */\n        IF (total_received + 1) > order_quantity THEN\n            RAISE EXCEPTION 'Cannot import drum. Quantity received would exceed the order''s limit. Quantity remaining: %', quantity_remaining;\n        END IF;\n\n    END IF;\n\n    -- If checks pass or tx_type != 'import', allow insertion\n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION inventory.set_drum_volume()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN -- Keep existing drum_volume if provided\n\tIF NEW.drum_volume IS NOT NULL THEN\n\t\t-- Do nothing, keep the provided drum_volume\n\t\tRETURN NEW;\n\tEND IF;\n\n\t-- Otherwise, calculate drum_volume from its provided weight\n\t-- NEW.drum_volume := mass_to_volume(NEW.material_id, NEW.drum_weight);\n\tNEW.drum_volume := 200;\n\n\tRETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION inventory.set_eta_range()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n    NEW.eta := DATERANGE(NEW.date_ordered, (NEW.date_ordered + INTERVAL '6 weeks')::date);\n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION inventory.set_material_id()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$ \nBEGIN\n    NEW.material_id := (\n        SELECT material_id \n        FROM public.raw_materials rm \n        WHERE rm.material_name = NEW.material_name\n    );\n    \n    -- If no matching material found, use the 'UNKNOWN' material_id\n    IF NEW.material_id IS NULL THEN\n        NEW.material_id := (\n            SELECT material_id \n            FROM public.raw_materials \n            WHERE material_name = 'UNKNOWN'\n        );\n    END IF;\n    \n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION inventory.set_material_type()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$BEGIN\n    -- Set material based on which TX source ID is not null\n    NEW.material := CASE\n        -- Fetch material from orders table via deliveries\n        WHEN NEW.delivery_id IS NOT NULL THEN\n            (\n                SELECT o.material\n                FROM inventory.deliveries d\n                JOIN inventory.orders o ON d.order_id = o.order_id\n                WHERE d.delivery_id = NEW.delivery_id\n            )\n        -- Fetch material directly from new_drums table\n        WHEN NEW.drum_id IS NOT NULL THEN\n            (\n                SELECT material\n                FROM inventory.new_drums\n                WHERE drum_id = NEW.drum_id\n            )\n        -- Fetch material directly from repro_drums table\n        WHEN NEW.repro_id IS NOT NULL THEN\n            (\n                SELECT material\n                FROM inventory.repro_drums\n                WHERE repro_drum_id = NEW.repro_id\n            )\n    END;\n\n    RETURN NEW;\nEND;$function$","CREATE OR REPLACE FUNCTION inventory.set_supplier_id()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$ \nBEGIN\n    NEW.supplier_id := (\n        SELECT supplier_id \n        FROM public.suppliers s\n        WHERE s.supplier_name = NEW.supplier_name\n    );\n    \n    -- If no matching supplier found, use the 'UNKNOWN' supplier_id\n    IF NEW.supplier_id IS NULL THEN\n        NEW.supplier_id := (\n            SELECT supplier_id \n            FROM public.suppliers \n            WHERE supplier_name = 'UNKNOWN'\n        );\n    END IF;\n    \n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION inventory.update_order_status_on_transaction()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nDECLARE\n    total_drums INT;\n    available_drums INT;\nBEGIN\n    -- Calculate the total number of drums for the order\n    SELECT COUNT(*)\n    INTO total_drums\n    FROM inventory.new_drums\n    WHERE order_id = NEW.order_id;\n\n    -- Calculate the number of drums with status 'in stock'\n    SELECT COUNT(*)\n    INTO available_drums\n    FROM inventory.new_drums\n    WHERE order_id = NEW.order_id AND status IN ('in stock', 'scheduled');\n\n    -- Update the order status based on the drum counts\n    IF available_drums = 0 THEN\n        UPDATE inventory.orders\n        SET status = 'pending',\n            updated_at = CURRENT_TIMESTAMP\n        WHERE order_id = NEW.order_id;\n    ELSIF available_drums < total_drums THEN\n        UPDATE inventory.orders\n        SET status = 'partial',\n            updated_at = CURRENT_TIMESTAMP\n        WHERE order_id = NEW.order_id;\n    ELSE\n        UPDATE inventory.orders\n        SET status = 'complete',\n            updated_at = CURRENT_TIMESTAMP\n        WHERE order_id = NEW.order_id;\n    END IF;\n\n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION inventory.update_repro_drum_status()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n    -- In trigger functions, NEW refers to the new row being inserted/updated\n    -- := is the PL/pgSQL assignment operator (different from SQL's = comparison operator)\n    \n    -- Set volume status based on volume added\n    IF NEW.current_volume = 0 THEN\n        NEW.volume_status := 'empty';\n    ELSIF NEW.current_volume >= NEW.capacity THEN\n        NEW.volume_status := 'full';\n    ELSE\n        NEW.volume_status := 'partial';\n    END IF;\n\n    -- Update the timestamp using PostgreSQL's CURRENT_TIMESTAMP function\n    -- This automatically sets the time zone based on the server's configuration\n    NEW.updated_at := CURRENT_TIMESTAMP;\n    \n    -- RETURN NEW is required for BEFORE triggers\n    -- It tells PostgreSQL to proceed with the actual update using our modified NEW record\n    RETURN NEW;\nEND;\n-- Below is a dollar-quoting mechanism to avoid having to escape quotes in the function body\n$function$","create schema if not exists \\"logs\\"","create sequence \\"logs\\".\\"distillation_loading_log_loading_id_seq\\"","create sequence \\"logs\\".\\"distillation_start_log_start_id_seq\\"","create sequence \\"logs\\".\\"distillation_transport_log_transport_id_seq\\"","create sequence \\"logs\\".\\"scan_log_scan_id_seq\\"","create table \\"logs\\".\\"auth_activity\\" (\n    \\"id\\" uuid not null default uuid_generate_v4(),\n    \\"user_id\\" uuid not null,\n    \\"action\\" text not null,\n    \\"ip_address\\" text,\n    \\"metadata\\" jsonb,\n    \\"created_at\\" timestamp with time zone default now()\n)","create table \\"logs\\".\\"drum_decommission\\" (\n    \\"decommission_id\\" integer generated by default as identity not null,\n    \\"drum_id\\" integer not null,\n    \\"decommissioned_at\\" timestamp with time zone default CURRENT_TIMESTAMP,\n    \\"worker_id\\" integer default 9\n)","alter table \\"logs\\".\\"drum_decommission\\" enable row level security","create table \\"logs\\".\\"drum_scan\\" (\n    \\"scan_id\\" integer not null default nextval('logs.scan_log_scan_id_seq'::regclass),\n    \\"scanned_at\\" timestamp with time zone default now(),\n    \\"drum_id\\" integer,\n    \\"user_id\\" integer not null default 9,\n    \\"scan_type\\" text not null,\n    \\"scan_status\\" text not null default 'success'::text,\n    \\"error_message\\" text\n)","create table \\"logs\\".\\"load_still\\" (\n    \\"loading_id\\" integer not null default nextval('logs.distillation_loading_log_loading_id_seq'::regclass),\n    \\"scan_id\\" integer,\n    \\"drum_id\\" integer,\n    \\"still_id\\" integer,\n    \\"distillation_id\\" integer not null,\n    \\"status\\" text default 'loaded'::text\n)","alter table \\"logs\\".\\"load_still\\" enable row level security","create table \\"logs\\".\\"log_start_distillation\\" (\n    \\"start_id\\" integer not null default nextval('logs.distillation_start_log_start_id_seq'::regclass),\n    \\"distillation_id\\" integer,\n    \\"still_id\\" integer not null,\n    \\"worker_id\\" integer,\n    \\"status\\" text default 'started'::text\n)","alter table \\"logs\\".\\"log_start_distillation\\" enable row level security","create table \\"logs\\".\\"log_transport_drum\\" (\n    \\"tran