aterial)","CREATE INDEX idx_drums_status ON obselete.new_drums USING btree (status)","CREATE INDEX idx_repro_drums_material_type ON obselete.repro_drums USING btree (material)","CREATE INDEX idx_repro_drums_status ON obselete.repro_drums USING btree (status)","CREATE INDEX idx_repro_drums_volume_status ON obselete.repro_drums USING btree (volume_status)","CREATE UNIQUE INDEX orders_pkey ON obselete.orders USING btree (order_id)","CREATE UNIQUE INDEX repro_drums_pkey ON obselete.repro_drums USING btree (repro_drum_id)","CREATE UNIQUE INDEX transactions_pkey ON obselete.transactions USING btree (tx_id)","CREATE UNIQUE INDEX unique_order_batch ON obselete.deliveries USING btree (order_id, batch_code)","alter table \\"obselete\\".\\"deliveries\\" add constraint \\"drum_deliveries_pkey\\" PRIMARY KEY using index \\"drum_deliveries_pkey\\"","alter table \\"obselete\\".\\"distillations\\" add constraint \\"distillations_pkey\\" PRIMARY KEY using index \\"distillations_pkey\\"","alter table \\"obselete\\".\\"new_drums\\" add constraint \\"drums_pkey\\" PRIMARY KEY using index \\"drums_pkey\\"","alter table \\"obselete\\".\\"orders\\" add constraint \\"orders_pkey\\" PRIMARY KEY using index \\"orders_pkey\\"","alter table \\"obselete\\".\\"repro_drums\\" add constraint \\"repro_drums_pkey\\" PRIMARY KEY using index \\"repro_drums_pkey\\"","alter table \\"obselete\\".\\"transactions\\" add constraint \\"transactions_pkey\\" PRIMARY KEY using index \\"transactions_pkey\\"","alter table \\"obselete\\".\\"deliveries\\" add constraint \\"deliveries_order_id_fkey\\" FOREIGN KEY (order_id) REFERENCES obselete.orders(order_id) not valid","alter table \\"obselete\\".\\"deliveries\\" validate constraint \\"deliveries_order_id_fkey\\"","alter table \\"obselete\\".\\"deliveries\\" add constraint \\"location_check\\" CHECK (((location)::text = ANY (ARRAY[('old-site'::character varying)::text, ('new-site'::character varying)::text]))) not valid","alter table \\"obselete\\".\\"deliveries\\