rt) AND (eta_start >= date_ordered))) not valid","alter table \\"obselete\\".\\"orders\\" validate constraint \\"eta_dates_valid\\"","alter table \\"obselete\\".\\"orders\\" add constraint \\"eta_end_requires_start\\" CHECK ((((eta_start IS NULL) AND (eta_end IS NULL)) OR ((eta_start IS NOT NULL) AND (eta_end IS NOT NULL)))) not valid","alter table \\"obselete\\".\\"orders\\" validate constraint \\"eta_end_requires_start\\"","alter table \\"obselete\\".\\"repro_drums\\" add constraint \\"repro_drums_location_check\\" CHECK (((location)::text = ANY (ARRAY[('new-site'::character varying)::text, ('old-site'::character varying)::text, ('TBD'::character varying)::text]))) not valid","alter table \\"obselete\\".\\"repro_drums\\" validate constraint \\"repro_drums_location_check\\"","alter table \\"obselete\\".\\"repro_drums\\" add constraint \\"repro_volume\\" CHECK (((current_volume >= 0) AND (current_volume <= 200))) not valid","alter table \\"obselete\\".\\"repro_drums\\" validate constraint \\"repro_volume\\"","alter table \\"obselete\\".\\"repro_drums\\" add constraint \\"valid_status\\" CHECK (((status)::text = ANY (ARRAY[('not full'::character varying)::text, ('available'::character varying)::text, ('scheduled'::character varying)::text, ('processed'::character varying)::text]))) not valid","alter table \\"obselete\\".\\"repro_drums\\" validate constraint \\"valid_status\\"","alter table \\"obselete\\".\\"repro_drums\\" add constraint \\"valid_volume_status\\" CHECK (((volume_status)::text = ANY (ARRAY[('empty'::character varying)::text, ('partial'::character varying)::text, ('full'::character varying)::text]))) not valid","alter table \\"obselete\\".\\"repro_drums\\" validate constraint \\"valid_volume_status\\"","alter table \\"obselete\\".\\"transactions\\" add constraint \\"transactions_delivery_id_fkey\\" FOREIGN KEY (delivery_id) REFERENCES obselete.deliveries(delivery_id) ON DELETE CASCADE not valid","alter table \\"obselete\\".\\"transactions\\" validate co