ng, volume_to_add integer)\n RETURNS void\n LANGUAGE plpgsql\nAS $function$\nDECLARE\n    target_drum_id INTEGER;\n    remaining_capacity INTEGER;\nBEGIN\n    -- Find a suitable drum of the given material type with enough capacity\n    SELECT repro_drum_id, (capacity - current_volume) AS remaining_capacity\n    INTO target_drum_id, remaining_capacity\n    FROM repro_drums rd\n    WHERE rd.material_type = repro_material\n      AND rd.capacity - rd.current_volume >= volume_to_add\n      AND rd.status = 'partial'  -- Ensure we only add to drums that are available for more material\n    ORDER BY rd.current_volume ASC  -- Prioritize the drum with the least amount of material\n    LIMIT 1;\n\n    -- If no suitable drum is found, raise an exception or handle as needed\n    IF target_drum_id IS NULL THEN\n        RAISE EXCEPTION 'No available repro drum with enough capacity for material type % and volume %', repro_material, volume_to_add;\n    END IF;\n\n    -- Update the selected drum's current volume\n    UPDATE repro_drums\n    SET current_volume = current_volume + volume_to_add,\n        updated_at = CURRENT_TIMESTAMP\n    WHERE repro_drum_id = target_drum_id;\n\n    -- Record this addition in the repro_additions table\n    INSERT INTO repro_additions (\n        repro_drum_id, \n        distillation_id, \n        date_added,\n        volume_added, \n        volume_in_drum\n    )\n    SELECT \n        target_drum_id,\n        distillation_id,\n        CURRENT_DATE,\n        volume_to_add,\n        current_volume\n    FROM repro_drums\n    WHERE repro_drum_id = target_drum_id;\nEND;\n$function$","create or replace view \\"public\\".\\"chemical_class_groups\\" as  SELECT DISTINCT raw_materials.chemical_group AS groups,\n    count(*) AS materials\n   FROM raw_materials\n  GROUP BY raw_materials.chemical_group","CREATE OR REPLACE FUNCTION public.date_add(arg1 timestamp with time zone, arg2 interval)\n RETURNS timestamp with time zone\n LANGUAGE sql\nAS $function$\nselect arg1+arg2\n$function$","CREATE OR REPLACE FUNCTION public.delete_expired_notifications()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$BEGIN\n    DELETE FROM notifications WHERE expires_at IS NOT NULL AND expires_at < NOW();\n    RETURN NULL; -- This ensures the function doesn't return anything\nEND;$function$","CREATE OR REPLACE FUNCTION public.enforce_stock_id_constraint()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$BEGIN\n    IF NEW.drum_type = 'new' THEN\n        -- Ensure stock_id exists in stock_new\n        IF NOT EXISTS (SELECT 1 FROM stock_new WHERE id = NEW.stock_id) THEN\n            RAISE EXCEPTION 'Invalid stock_id: % does not exist in stock_new', NEW.stock_id;\n        END IF;\n    ELSIF NEW.drum_type = 'repro' THEN\n        -- Ensure stock_id exists in stock_repro\n        IF NOT EXISTS (SELECT 1 FROM stock_repro WHERE stock_id = NEW.stock_id) THEN\n            RAISE EXCEPTION 'Invalid stock_id: % does not exist in stock_repro', NEW.stock_id;\n        END IF;\n    END IF;\n    RETURN NEW;\nEND;$function$","CREATE OR REPLACE FUNCTION public.generate_stock_drums()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$BEGIN\n    INSERT INTO stock_drum (drum_type, order_detail_id, status, created_at, updated_at)\n    SELECT 'new', NEW.detail_id, 'en_route', NOW(), NOW()\n    FROM generate_series(1, NEW.drum_quantity); -- Generate N rows per quantity ordered\n\n    RETURN NEW;\nEND;$function$","CREATE OR REPLACE FUNCTION public.handle_empty_drums()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$BEGIN\n    -- If the drum has reached 0 volume, update its status\n    IF NEW.remaining_volume = 0 THEN\n        -- Mark drum as 'empty' so it can be removed or reused\n        UPDATE stock_drum\n        SET status = 'empty'\n        WHERE drum_id = NEW.drum_id;\n\n        -- Log the event in a table for tracking purposes\n        INSERT INTO drum_decommission_log (drum_id, decommissioned_at, worker_id)\n        VALUES (NEW.drum_id, NOW(), NEW.worker_id);\n        \n        -- Optionally: Notify staff\n        INSERT INTO notifications (message, created_at)\n        VALUES (format('Drum ID %s is now empty and should be decommissioned.', NEW.drum_id), NOW());\n\n    END IF;\n    RETURN NEW;\nEND;$function$","CREATE OR REPLACE FUNCTION public.handle_new_user()\n RETURNS trigger\n LANGUAGE plpgsql\n SECURITY DEFINER\nAS $function$\nbegin\n  insert into public.profiles (id, full_name, avatar_url, email)\n  values (\n    new.id,                                              -- Use the new auth user's ID\n    new.raw_user_meta_data->>'full_name',               -- Extract from metadata JSON\n    new.raw_user_meta_data->>'avatar_url',              -- Extract from metadata JSON\n    new.raw_user_meta_data->>'email'                    -- Extract from metadata JSON\n    );\n  return new;\nend;\n$function$","CREATE OR REPLACE FUNCTION public.insert_stock_new()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$DECLARE existing_stock_id INT;\nBEGIN\n    -- Check if stock_new already has the material+supplier combination\n    SELECT stock_id INTO existing_stock_id\n    FROM stock_new\n    WHERE material_id = NEW.material_id\n    AND supplier_id = (SELECT supplier_id FROM stock_order WHERE order_id = NEW.order_id)\n    LIMIT 1;\n\n    -- If stock exists, update quantity\n    IF existing_stock_id IS NOT NULL THEN\n        UPDATE stock_new\n        SET quantity = quantity + NEW.drum_quantity, updated_at = NOW()\n        WHERE stock_id = existing_stock_id;\n    ELSE\n        -- If stock does not exist, create a new row\n        INSERT INTO stock_new (material_id, supplier_id, quantity, location, batch_code, created_at, updated_at, detail_id)\n        VALUES (\n            NEW.material_id,\n            (SELECT supplier_id FROM stock_order WHERE order_id = NEW.order_id),\n            NEW.drum_quantity,\n            NULL,  -- Default location for new stock\n            NULL, -- Batch code is recorded later\n            NOW(), NOW(), -- Timestamps\n            NEW.detail_id -- Link to stock_order_details\n        );\n    END IF;\n\n    RETURN NEW;\nEND;$function$","CREATE OR REPLACE FUNCTION public.mass_to_volume(material_id integer, weight numeric)\n RETURNS numeric\n LANGUAGE plpgsql\n IMMUTABLE\nAS $function$\nDECLARE\n    density NUMERIC;\nBEGIN\n    SELECT density INTO density FROM public.raw_materials rm WHERE rm.material_id = material_id;\n    RETURN weight / density;\nEXCEPTION\n    WHEN NO_DATA_FOUND THEN\n        -- RAISE EXCEPTION 'Material not found';\n        RETURN 200;\nEND;\n$function$","create or replace view \\"public\\".\\"product_source_material\\" as  SELECT p.product_id,\n    r.material_id AS raw_material_id,\n    p.name AS product,\n    p.sku,\n    r.material_name AS material\n   FROM (config.ref_product p\n     LEFT JOIN raw_materials r ON ((r.material_id = p.raw_material_id)))","create or replace view \\"public\\".\\"product_table\\" as  SELECT p.name,\n    p.grade,\n    p.sku,\n    r.cas_number AS cas\n   FROM (config.ref_product p\n     JOIN raw_materials r ON ((p.raw_material_id = r.material_id)))\n  ORDER BY p.grade, p.name","create or replace view \\"public\\".\\"stock_history_compatibility_view\\" as  SELECT stock_activity.id,\n    stock_activity.activity_date AS date,\n    stock_activity.material_code,\n    stock_activity.supplier_id,\n    stock_activity.quantity,\n    stock_activity.drum_type,\n    stock_activity.drum_ids,\n    stock_activity.batch_code,\n    stock_activity.source_record_id,\n    stock_activity.created_at,\n    stock_activity.updated_at\n   FROM stock_activity","CREATE OR REPLACE FUNCTION public.update_material_code()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n    -- Update the material_code for all records in stock_history that match the new material_name\n    UPDATE public.stock_history\n    SET material_code = ref_materials.code\n    FROM ref_materials\n    WHERE ref_materials.value = NEW.material_name\n      AND stock_history.material_name = NEW.material_name;\n\n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.update_modified_column()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n    NEW.updated_at = CURRENT_TIMESTAMP;\n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.update_stock_drums_status()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$BEGIN\n  UPDATE stock_drum\n  SET status = 'in_stock',\n    updated_at = NOW()\n  WHERE order_detail_id = NEW.detail_id;\n\n  RETURN NEW;\nEND;$function$","CREATE OR REPLACE FUNCTION public.update_stock_new_on_arrival()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$DECLARE\n    existing_stock_id INT;\nBEGIN\n    -- Find if stock batch already exists\n    SELECT stock_id INTO existing_stock_id\n    FROM stock_new\n    WHERE material_id = (SELECT material_id FROM order_detail WHERE detail_id = NEW.detail_id)\n\t    AND batch_code = (SELECT batch_code FROM order_detail WHERE detail_id = NEW.detail_id)\n\t    AND supplier_id = (SELECT supplier_id FROM stock_order WHERE order_id = \n                        (SELECT order_id FROM order_detail WHERE detail_id = NEW.detail_id))\n    LIMIT 1;\n\n    -- If stock exists, update quantity\n    IF existing_stock_id IS NOT NULL THEN\n        UPDATE stock_new\n        SET quantity = quantity + 1, updated_at = NOW()\n        WHERE stock_id = existing_stock_id;\n    ELSE\n        -- If stock does not exist, create a new batch\n        INSERT INTO stock_new (material_id, supplier_id, quantity, batch_code, location, created_at, updated_at)\n        VALUES (\n            (SELECT material_id FROM order_detail WHERE detail_id = NEW.detail_id),\n            (SELECT supplier_id FROM stock_order WHERE order_id = \n                    (SELECT order_id FROM order_detail WHERE detail_id = NEW.detail_id)),\n            1,\n            (SELECT batch_code FROM order_detail WHERE detail_id = NEW.detail_id),\n\t\t\t 'New Site', NOW(), NOW()\n        );\n    END IF;\n\n    -- Update drum status to 'in stock'\n    UPDATE stock_drum\n    SET updated_at = NOW()\n    WHERE drum_id = NEW.drum_id;\n\n    RETURN NEW;\nEND;$function$","CREATE OR REPLACE FUNCTION public.update_timestamp()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n    NEW.updated_at = CURRENT_TIMESTAMP;\n    RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.update_updated_at()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n    NEW.updated_at := NOW();  -- Set updated_at to the current timestamp\n    RETURN NEW;  -- Return the modified row\nEND;\n$function$","create or replace view \\"public\\".\\"vw_drum_inventory\\" as  WITH stock_new_summary AS (\n         SELECT stock_new.material_code,\n            COALESCE(sum(stock_new.quantity), (0)::bigint) AS total_quantity\n           FROM stock_new\n          GROUP BY stock_new.material_code\n        ), stock_repro_summary AS (\n         SELECT stock_repro.material_code,\n            COALESCE(sum(stock_repro.quantity), (0)::bigint) AS total_quantity\n           FROM stock_repro\n          GROUP BY stock_repro.material_code\n        )\n SELECT rm.code,\n    rm.value,\n    COALESCE(sns.total_quantity, (0)::bigint) AS raw_drums,\n    COALESCE(srs.total_quantity, (0)::bigint) AS repro_drums,\n    rm.chemical_group AS ch_group,\n    10 AS threshold\n   FROM ((ref_materials rm\n     LEFT JOIN stock_new_summary sns ON ((sns.material_code = (rm.code)::text)))\n     LEFT JOIN stock_repro_summary srs ON ((srs.material_code = (rm.code)::text)))","create or replace view \\"public\\".\\"vw_material_consumption\\" as  WITH monthly_data AS (\n         SELECT stock_history.material_code,\n            stock_history.material_name,\n            date_trunc('month'::text, (stock_history.date)::timestamp with time zone) AS month,\n            sum(stock_history.change) AS monthly_quantity\n           FROM stock_history\n          GROUP BY stock_history.material_code, stock_history.material_name, (date_trunc('month'::text, (stock_history.date)::timestamp with time zone))\n        )\n SELECT md.material_code,\n    md.material_name,\n    md.month,\n    md.monthly_quantity,\n    sum(md.monthly_quantity) OVER (PARTITION BY md.material_code ORDER BY md.month ROWS BETWEEN UNBOUNDED PRECEDING AND CURRENT ROW) AS running_total\n   FROM monthly_data md\n  ORDER BY md.material_code, md.month","create or replace view \\"public\\".\\"vw_order_history\\" as  SELECT sub.order_id,\n    sub.date_ordered,\n    sub.batch_code,\n    sub.material_description,\n    sub.drum_quantity,\n    sub.order_count\n   FROM ( SELECT sod.order_id,\n            so.date_ordered,\n            sod.batch_code,\n            sod.material_name AS material_description,\n            sod.drum_quantity,\n            count(*) OVER (PARTITION BY so.order_id) AS order_count\n           FROM (order_detail sod\n             JOIN stock_order so ON ((so.order_id = sod.order_id)))) sub\n  WHERE (sub.order_count > 1)\n  ORDER BY sub.order_id","create or replace view \\"public\\".\\"vw_pending_assignments\\" as  SELECT pa.pending_id,\n    pa.drum_id,\n    pa.transport_id,\n    pa.assigned_distillation_id,\n    pa.status,\n    log.scanned_at AS transported_at,\n    (now() - log.scanned_at) AS pending_time\n   FROM (distillation_pending_assignment pa\n     JOIN LATERAL ( SELECT log_1.scanned_at\n           FROM logs.drum_scan log_1\n          WHERE ((log_1.drum_id = pa.drum_id) AND (log_1.scan_type = 'transport'::text))\n          ORDER BY log_1.scanned_at DESC\n         LIMIT 1) log ON (true))\n  WHERE (pa.status = 'pending'::text)","create or replace view \\"public\\".\\"vw_stock_history_analysis\\" as  SELECT sh.id,\n    sh.date,\n    rm.value AS material_name,\n    rm.code AS material_code,\n    rm.chemical_group,\n    s.supplier_name,\n    sh.change AS quantity,\n    sh.drum_type,\n    sh.drum_ids,\n    sh.batch_code,\n    EXTRACT(year FROM sh.date) AS year,\n    EXTRACT(month FROM sh.date) AS month,\n    EXTRACT(quarter FROM sh.date) AS quarter\n   FROM ((stock_history sh\n     LEFT JOIN ref_materials rm ON (((sh.material_code)::text = (rm.code)::text)))\n     LEFT JOIN ref_suppliers s ON ((sh.supplier_id = s.supplier_id)))","create or replace view \\"public\\".\\"vw_supplier_analysis\\" as  SELECT sh.supplier_id,\n    sh.supplier_name,\n    count(*) AS total_transactions,\n    count(DISTINCT sh.material_code) AS unique_materials,\n    sum(\n        CASE\n            WHEN (sh.change < 0) THEN 1\n            ELSE 0\n        END) AS outgoing_transactions,\n    sum(\n        CASE\n            WHEN (sh.change > 0) THEN 1\n            ELSE 0\n        END) AS incoming_transactions,\n    sum(\n        CASE\n            WHEN (sh.change < 0) THEN sh.change\n            ELSE 0\n        END) AS total_outgoing,\n    sum(\n        CASE\n            WHEN (sh.change > 0) THEN sh.change\n            ELSE 0\n        END) AS total_incoming\n   FROM stock_history sh\n  GROUP BY sh.supplier_id, sh.supplier_name\n  ORDER BY (count(*)) DESC","grant delete on table \\"public\\".\\"distillation_pending_assignment\\" to \\"anon\\"","grant insert on table \\"public\\".\\"distillation_pending_assignment\\" to \\"anon\\"","grant references on table \\"public\\".\\"distillation_pending_assignment\\" to \\"anon\\"","grant select on table \\"public\\".\\"distillation_pending_assignment\\" to \\"anon\\"","grant trigger on table \\"public\\".\\"distillation_pending_assignment\\" to \\"anon\\"","grant truncate on table \\"public\\".\\"distillation_pending_assignment\\" to \\"anon\\"","grant update on table \\"public\\".\\"distillation_pending_assignment\\" to \\"anon\\"","grant delete on table \\"public\\".\\"distillation_pending_assignment\\" to \\"authenticated\\"","grant insert on table \\"public\\".\\"distillation_pending_assignment\\" to \\"authenticated\\"","grant references on table \\"public\\".\\"distillation_pending_assignment\\" to \\"authenticated\\"","grant select on table \\"public\\".\\"distillation_pe