--
-- Name: get_all_table_row_counts(); Type: FUNCTION; Schema: analytics; Owner: postgres
--

CREATE FUNCTION analytics.get_all_table_row_counts() RETURNS TABLE(table_name text, row_count bigint)
    LANGUAGE plpgsql
    AS $$
DECLARE
    query text;
    r record;
BEGIN
    FOR r IN (SELECT t.table_name 
              FROM information_schema.tables t
              WHERE t.table_schema = 'public' 
              AND t.table_type = 'BASE TABLE')
    LOOP
        query := 'SELECT ''' || r.table_name || '''::text, COUNT(*)::bigint FROM public.' || quote_ident(r.table_name);
        RETURN QUERY EXECUTE query;
    END LOOP;
END;
$$;


ALTER FUNCTION analytics.get_all_table_row_counts() OWNER TO postgres;

