    drum_id INT;
BEGIN
    IF NEW.tx_type IN ('disposed', 'lost') THEN
        drum_id := NEW.drum_id;
        IF drum_id IS NOT NULL THEN
            UPDATE inventory.new_drums
            SET status = NEW.tx_type,
                updated_at = CURRENT_TIMESTAMP
            WHERE drum_id = drum_id;
        END IF;
    END IF;

    RETURN NEW;
