CREATE FUNCTION public.update_stock_drums_status() RETURNS trigger
    LANGUAGE plpgsql
    AS $$BEGIN
  UPDATE stock_drum
  SET status = 'in_stock',
    updated_at = NOW()
  WHERE order_detail_id = NEW.detail_id;

  RETURN NEW;
END;$$;


ALTER FUNCTION public.update_stock_drums_status() OWNER TO postgres;

--
-- Name: update_stock_new_on_arrival(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.update_stock_new_on_arrival() RETURNS trigger
    LANGUAGE plpgsql
    AS $$DECLARE
    existing_stock_id INT;
BEGIN
    -- Find if stock batch already exists
    SELECT stock_id INTO existing_stock_id
    FROM stock_new
    WHERE material_id = (SELECT material_id FROM order_detail WHERE detail_id = NEW.detail_id)
	    AND batch_code = (SELECT batch_code FROM order_detail WHERE detail_id = NEW.detail_id)
	    AND supplier_id = (SELECT supplier_id FROM stock_order WHERE order_id = 
                        (SELECT order_id FROM order_detail WHERE detail_id = NEW.detail_id))
    LIMIT 1;

    -- If stock exists, update quantity
    IF existing_stock_id IS NOT NULL THEN
        UPDATE stock_new
        SET quantity = quantity + 1, updated_at = NOW()
        WHERE stock_id = existing_stock_id;
    ELSE
        -- If stock does not exist, create a new batch
        VALUES (
            (SELECT material_id FROM order_detail WHERE detail_id = NEW.detail_id),
            (SELECT supplier_id FROM stock_order WHERE order_id = 
                    (SELECT order_id FROM order_detail WHERE detail_id = NEW.detail_id)),
            1,
            (SELECT batch_code FROM order_detail WHERE detail_id = NEW.detail_id),
			 'New Site', NOW(), NOW()
        );
    END IF;

    -- Update drum status to 'in stock'
    UPDATE stock_drum
    SET updated_at = NOW()
    WHERE drum_id = NEW.drum_id;

    RETURN NEW;
END;$$;


ALTER FUNCTION public.update_stock_new_on_arrival() OWNER TO postgres;

