--
-- Name: delivered_drums; Type: VIEW; Schema: obselete; Owner: postgres
--

CREATE VIEW obselete.delivered_drums AS
 SELECT d.drum_id,
    dv.date_received,
    d.date_processed,
    d.status,
    o.supplier,
    o.material,
    dv.batch_code
   FROM ((obselete.new_drums d
     JOIN obselete.orders o ON ((d.order_id = o.order_id)))
     JOIN obselete.deliveries dv ON ((d.order_id = dv.order_id)))
  ORDER BY dv.date_received;


