    SEQUENCE NAME obselete.transactions_tx_id_seq
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1
);


--
-- Name: transactions_view; Type: VIEW; Schema: obselete; Owner: postgres
--

CREATE VIEW obselete.transactions_view AS
 SELECT t.tx_id,
    t.tx_type,
    t.tx_date,
    t.material,
    t.drum_id,
    t.repro_id,
    t.tx_notes,
    t.created_at,
    t.updated_at,
    t.process_id,
    t.direction,
    t.delivery_id
   FROM (((obselete.transactions t
     LEFT JOIN obselete.deliveries d ON ((t.delivery_id = d.delivery_id)))
     LEFT JOIN obselete.new_drums nd ON ((t.drum_id = nd.drum_id)))
     LEFT JOIN obselete.repro_drums rd ON ((t.repro_id = rd.repro_drum_id)))
  ORDER BY t.created_at DESC
 LIMIT 100;


