--
-- Name: vw_drum_inventory; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vw_drum_inventory AS
 WITH stock_new_summary AS (
         SELECT stock_new.material_code,
            COALESCE(sum(stock_new.quantity), (0)::bigint) AS total_quantity
           FROM public.stock_new
          GROUP BY stock_new.material_code
        ), stock_repro_summary AS (
         SELECT stock_repro.material_code,
            COALESCE(sum(stock_repro.quantity), (0)::bigint) AS total_quantity
           FROM public.stock_repro
          GROUP BY stock_repro.material_code
        )
 SELECT rm.code,
    rm.value,
    COALESCE(sns.total_quantity, (0)::bigint) AS raw_drums,
    COALESCE(srs.total_quantity, (0)::bigint) AS repro_drums,
    rm.chemical_group AS ch_group,
    10 AS threshold
   FROM ((public.ref_materials rm
     LEFT JOIN stock_new_summary sns ON ((sns.material_code = (rm.code)::text)))
     LEFT JOIN stock_repro_summary srs ON ((srs.material_code = (rm.code)::text)));


ALTER VIEW public.vw_drum_inventory OWNER TO postgres;

--
-- Name: vw_material_consumption; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vw_material_consumption AS
 WITH monthly_data AS (
         SELECT stock_history.material_code,
            stock_history.material_name,
            date_trunc('month'::text, (stock_history.date)::timestamp with time zone) AS month,
            sum(stock_history.change) AS monthly_quantity
           FROM public.stock_history
          GROUP BY stock_history.material_code, stock_history.material_name, (date_trunc('month'::text, (stock_history.date)::timestamp with time zone))
        )
 SELECT md.material_code,
    md.material_name,
    md.month,
    md.monthly_quantity,
    sum(md.monthly_quantity) OVER (PARTITION BY md.material_code ORDER BY md.month ROWS BETWEEN UNBOUNDED PRECEDING AND CURRENT ROW) AS running_total
   FROM monthly_data md
  ORDER BY md.material_code, md.month;


ALTER VIEW public.vw_material_consumption OWNER TO postgres;

--
-- Name: vw_order_history; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vw_order_history AS
 SELECT sub.order_id,
    sub.date_ordered,
    sub.batch_code,
    sub.material_description,
    sub.drum_quantity,
    sub.order_count
   FROM ( SELECT sod.order_id,
            so.date_ordered,
            sod.batch_code,
            sod.material_name AS material_description,
            sod.drum_quantity,
            count(*) OVER (PARTITION BY so.order_id) AS order_count
           FROM (public.order_detail sod
             JOIN public.stock_order so ON ((so.order_id = sod.order_id)))) sub
  WHERE (sub.order_count > 1)
  ORDER BY sub.order_id;


ALTER VIEW public.vw_order_history OWNER TO postgres;

--
-- Name: vw_pending_assignments; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vw_pending_assignments AS
 SELECT pa.pending_id,
    pa.drum_id,
    pa.transport_id,
    pa.assigned_distillation_id,
    pa.status,
    log.scanned_at AS transported_at,
    (now() - log.scanned_at) AS pending_time
   FROM (public.distillation_pending_assignment pa
     JOIN LATERAL ( SELECT log_1.scanned_at
           FROM logs.drum_scan log_1
          WHERE ((log_1.drum_id = pa.drum_id) AND (log_1.scan_type = 'transport'::text))
          ORDER BY log_1.scanned_at DESC
         LIMIT 1) log ON (true))
  WHERE (pa.status = 'pending'::text);


ALTER VIEW public.vw_pending_assignments OWNER TO postgres;

--
-- Name: vw_stock_history_analysis; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vw_stock_history_analysis AS
 SELECT sh.id,
    sh.date,
    rm.value AS material_name,
    rm.code AS material_code,
    rm.chemical_group,
    s.supplier_name,
    sh.change AS quantity,
    sh.drum_type,
    sh.drum_ids,
    sh.batch_code,
    EXTRACT(year FROM sh.date) AS year,
    EXTRACT(month FROM sh.date) AS month,
    EXTRACT(quarter FROM sh.date) AS quarter
   FROM ((public.stock_history sh
     LEFT JOIN public.ref_materials rm ON (((sh.material_code)::text = (rm.code)::text)))
     LEFT JOIN public.ref_suppliers s ON ((sh.supplier_id = s.supplier_id)));


ALTER VIEW public.vw_stock_history_analysis OWNER TO postgres;

--
-- Name: vw_supplier_analysis; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vw_supplier_analysis AS
 SELECT sh.supplier_id,
    sh.supplier_name,
    count(*) AS total_transactions,
    count(DISTINCT sh.material_code) AS unique_materials,
    sum(
        CASE
            WHEN (sh.change < 0) THEN 1
            ELSE 0
        END) AS outgoing_transactions,
    sum(
        CASE
            WHEN (sh.change > 0) THEN 1
            ELSE 0
        END) AS incoming_transactions,
    sum(
        CASE
            WHEN (sh.change < 0) THEN sh.change
            ELSE 0
        END) AS total_outgoing,
    sum(
        CASE
            WHEN (sh.change > 0) THEN sh.change
            ELSE 0
        END) AS total_incoming
   FROM public.stock_history sh
  GROUP BY sh.supplier_id, sh.supplier_name
  ORDER BY (count(*)) DESC;


ALTER VIEW public.vw_supplier_analysis OWNER TO postgres;

